import React from 'react';

const styles = {
  border: '1px solid black',
  margin: '12px',
  textAlign: 'center'
};

const ListItem = ({ item }) => {
  return (
    <div style={styles}>
      <h5>{item.name}</h5>
      <h5>{item.distance / 1000} kms</h5>
    </div>
  );
};

export default ListItem;
